import React from 'react';
import './login-style.css';
import $ from 'jquery'; 


function fun(){
	$(".log-in").click(function(){
		$(".signIn").addClass("active-dx");
		$(".signUp").addClass("inactive-sx");
		$(".signUp").removeClass("active-sx");
		$(".signIn").removeClass("inactive-dx");
	});
}

$(".back").click(function(){
	$(".signUp").addClass("active-sx");
	$(".signIn").addClass("inactive-dx");
	$(".signIn").removeClass("active-dx");
	$(".signUp").removeClass("inactive-sx");
});


const SignIn = () => {
	return (
		<div className="container">
		<form className="signUp">
			<h3>Create Your Account</h3>
			<p>Just enter your email address<br />
			and your password for join.
			</p>
			<input className="w100" type="email" placeholder="Insert email" reqired autocomplete='off' />
			<input type="password" placeholder="Insert password" reqired />
			<input type="password" placeholder="Verify password" reqired />
			<button className="form-btn sx log-in" type="button">Log In</button>
			<button className="form-btn dx" type="submit"><a href="mainpage.html">Sign Up</a></button>
		</form>
		<form className="signIn">
			<h3>Welcome<br />Back to<br />
			Tamagochi !</h3><br />
			<input type="email" placeholder="Insert email" autocomplete='off' reqired />
			<input type="password" placeholder="Insert password" reqired />
			<button className="form-btn sx back" type="button">Back</button>
			<button className="form-btn dx" type="submit">Log In</button>
		</form>
	</div>

	);
}

export default SignIn;
